#include <iostream>#include <algorithm>#include <math.h>#include <string>#include <vector>using namespace std;int main() {	string str;	vector<int> vec;	for (int i = 1; i <= 5; i++) {		cin >> str;		for (int j = 0; j < str.length()-2; j++) {			if (str[j] == 'F'&&str[j+1]=='B'&&str[j+2]=='I') {				vec.push_back(i);				break;			}		}	}	if (vec.size() == 0) cout << "HE GOT AWAY!";	else {		sort(vec.begin(), vec.end());		for (int i = 0; i < vec.size(); i++) {			cout << vec[i] << ' ';		}	}}